--  DDL for Procedure PR_BUSCAR_FERIADO_ID
--------------------------------------------------------
set define off;

  CREATE OR REPLACE PROCEDURE "SGP"."PR_BUSCAR_FERIADO_ID" (p_id IN FERIADOS.ID_FERIADO%TYPE, p_feriado OUT FERIADOS.FERIADO%TYPE, p_descripcion OUT FERIADOS.DESCRIPCION%TYPE,p_resultado OUT VARCHAR2)
IS
BEGIN
SELECT FERIADO, DESCRIPCION 
INTO p_feriado, p_descripcion
FROM FERIADOS
WHERE ID_FERIADO LIKE p_id;
p_resultado := 'Datos encontrados';
END PR_BUSCAR_FERIADO_ID;

