--------------------------------------------------------
--  DDL for Procedure PR_BUSCAR_TIPO_PERMISO
--------------------------------------------------------
set define off;

  CREATE OR REPLACE PROCEDURE "SGP"."PR_BUSCAR_TIPO_PERMISO" (p_id_tipo IN PERMISO_TIPOS.ID_TIPO%TYPE, p_tipo OUT PERMISO_TIPOS.TIPO%TYPE, p_dias OUT PERMISO_TIPOS.DIAS%TYPE, p_descripcion OUT PERMISO_TIPOS.DESCRIPCION%TYPE, p_estado_tipo OUT PERMISO_TIPOS.ESTADO_TIPO%TYPE, p_resultado OUT VARCHAR2)
IS
BEGIN
SELECT TIPO , DIAS , DESCRIPCION, ESTADO_TIPO
INTO p_tipo, p_dias , p_descripcion , p_estado_tipo
FROM PERMISO_TIPOS
WHERE ID_TIPO LIKE p_id_tipo;
IF(p_dias>0) THEN 
p_resultado := 'Datos encontrados';
ELSE 
p_resultado := 'No se encontraron datos asociados';
END IF;
END PR_BUSCAR_TIPO_PERMISO;

