--  DDL for Package Body MOSTRAR_USUARIO
--------------------------------------------------------

  CREATE OR REPLACE PACKAGE BODY "SGP"."MOSTRAR_USUARIO" IS
PROCEDURE  PR_MOSTRAR_USUARIO(v_cursor OUT vCursor) --ES DE TIPO CURSOR
IS
BEGIN
OPEN v_cursor FOR
    SELECT U.RUT, U.DV, U.CLAVE, U.NOMBRES, U.APELLIDO_PATERNO, U.APELLIDO_MATERNO, U.DIRECCION, U.COMUNA, U.TELEFONO, U.EMAIL, U.DD_LEGALES, U.DD_ADMINISTRATIVOS, U.FECHA_CONTRATO, UP.PERFIL , UC.CARGO , UD.DEPARTAMENTO
    FROM USUARIOS U JOIN USUARIO_PERFILES UP      ON (U.PERFIL = UP.ID_PERFIL)
                    JOIN USUARIO_CARGOS UC        ON (U.CARGO = UC.ID_CARGO) 
                    JOIN USUARIO_DEPARTAMENTOS UD ON (U.DEPARTAMENTO = UD.ID_DEPARTAMENTO) 
    ORDER BY RUT DESC, NOMBRES DESC;
END  PR_MOSTRAR_USUARIO;
END MOSTRAR_USUARIO;

